import React, { useState, useEffect } from 'react';
import { ChevronUp, ChevronDown, RefreshCw, Filter } from 'lucide-react';
import { apiService } from '../services/api';
import './DataTable.css';

const DataTable = ({ showEntries, setShowEntries, searchTerm, setSearchTerm }) => {
  const [visitors, setVisitors] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [currentPage, setCurrentPage] = useState(1);
  const [filterProjectId, setFilterProjectId] = useState('');
  const [filterStatus, setFilterStatus] = useState('');

  const tableHeaders = [
    { key: 'sno', label: 'S.No', sortable: false },
    { key: 'projectId', label: 'Project ID', sortable: true },
    { key: 'userId', label: 'User ID', sortable: true },
    { key: 'status', label: 'Status', sortable: true },
    { key: 'ip', label: 'IP Address', sortable: true },
    { key: 'createdAt', label: 'Date & Time', sortable: true }
  ];

  const fetchVisitors = async () => {
    try {
      setLoading(true);
      const data = await apiService.getVisitors();
      setVisitors(data);
      setError(null);
    } catch (err) {
      setError('Failed to load visitor data');
      console.error('Error fetching visitors:', err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchVisitors();
  }, []);

  // Filter and paginate data
  const filteredData = visitors.filter(visitor => {
    // Search filter
    if (searchTerm) {
      const searchLower = searchTerm.toLowerCase();
      const projectId = visitor.projectId?.toString().toLowerCase() || '';
      const userId = visitor.userId?.toString().toLowerCase() || '';
      const status = visitor.status?.toString().toLowerCase() || '';
      const ip = visitor.ip?.toString().toLowerCase() || '';

      const matchesSearch = (
        projectId.includes(searchLower) ||
        userId.includes(searchLower) ||
        status.includes(searchLower) ||
        ip.includes(searchLower)
      );

      if (!matchesSearch) return false;
    }

    // Project ID filter
    if (filterProjectId) {
      const visitorProjectId = visitor.projectId?.toString().toLowerCase() || '';
      if (!visitorProjectId.includes(filterProjectId.toLowerCase())) {
        return false;
      }
    }

    // Status filter
    if (filterStatus) {
      const visitorStatus = visitor.status?.toString().toLowerCase() || '';
      if (visitorStatus !== filterStatus.toLowerCase()) {
        return false;
      }
    }

    return true;
  });

  const totalEntries = filteredData.length;
  const totalPages = Math.ceil(totalEntries / showEntries);
  const startIndex = (currentPage - 1) * showEntries;
  const endIndex = startIndex + showEntries;
  const currentData = filteredData.slice(startIndex, endIndex);

  const handleRefresh = () => {
    fetchVisitors();
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleString();
  };

  if (loading) {
    return (
      <div className="data-table-container">
        <div className="table-controls">
          <div className="entries-control">
            <label>Show</label>
            <select 
              value={showEntries} 
              onChange={(e) => setShowEntries(Number(e.target.value))}
            >
              <option value={10}>10</option>
              <option value={25}>25</option>
              <option value={50}>50</option>
              <option value={100}>100</option>
            </select>
            <span>entries</span>
          </div>

          <div className="search-control">
            <label>Search:</label>
            <input
              type="text"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              placeholder="Search..."
            />
          </div>
        </div>

        <div className="loading-state">
          <RefreshCw size={24} className="spinning" />
          <p>Loading visitor data...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="data-table-container">
      {/* Table Controls */}
      <div className="table-controls">
        <div className="entries-control">
          <label>Show</label>
          <select 
            value={showEntries} 
            onChange={(e) => setShowEntries(Number(e.target.value))}
          >
            <option value={10}>10</option>
            <option value={25}>25</option>
            <option value={50}>50</option>
            <option value={100}>100</option>
          </select>
          <span>entries</span>
        </div>

        <div className="search-control">
          <label>Search:</label>
          <input
            type="text"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            placeholder="Search visitors..."
          />
        </div>

        <div className="refresh-control">
          <RefreshCw size={16} onClick={handleRefresh} style={{ cursor: 'pointer' }} />
        </div>
      </div>

      {/* Filter Controls */}
      <div className="filter-controls">
        <div className="filter-group">
          <label>Filter by Project ID:</label>
          <input
            type="text"
            value={filterProjectId}
            onChange={(e) => setFilterProjectId(e.target.value)}
            placeholder="Enter Project ID..."
          />
        </div>

        <div className="filter-group">
          <label>Filter by Status:</label>
          <select
            value={filterStatus}
            onChange={(e) => setFilterStatus(e.target.value)}
          >
            <option value="">All Status</option>
            <option value="visit">Visit</option>
            <option value="click">Click</option>
            <option value="active">Active</option>
            <option value="inactive">Inactive</option>
            <option value="pending">Pending</option>
          </select>
        </div>

        <div className="filter-actions">
          <button 
            className="clear-filters-btn"
            onClick={() => {
              setFilterProjectId('');
              setFilterStatus('');
              setSearchTerm('');
            }}
          >
            Clear Filters
          </button>
        </div>
      </div>

      {/* Table */}
      <div className="table-wrapper">
        <table className="data-table">
          <thead>
            <tr>
              {tableHeaders.map((header) => (
                <th key={header.key} className="table-header">
                  <div className="header-content">
                    <span>{header.label}</span>
                    {header.sortable && (
                      <div className="sort-icons">
                        <ChevronUp size={12} />
                        <ChevronDown size={12} />
                      </div>
                    )}
                  </div>
                </th>
              ))}
            </tr>
          </thead>
          <tbody>
            {currentData.length > 0 ? (
              currentData.map((visitor, index) => (
                <tr key={visitor._id || index}>
                  <td>{startIndex + index + 1}</td>
                  <td>{visitor.projectId}</td>
                  <td>{visitor.userId}</td>
                  <td>
                    <span className={`status-badge status-${visitor.status?.toLowerCase()}`}>
                      {visitor.status}
                    </span>
                  </td>
                  <td>{visitor.ip}</td>
                  <td>{formatDate(visitor.createdAt)}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan={tableHeaders.length} className="no-data">
                  {error ? error : 'No visitor data available'}
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>

      {/* Pagination */}
      <div className="pagination-info">
        <div className="entries-info">
          Showing {startIndex + 1} to {Math.min(endIndex, totalEntries)} of {totalEntries} entries
        </div>
        <div className="pagination-controls">
          <button 
            className="pagination-btn" 
            disabled={currentPage === 1}
            onClick={() => setCurrentPage(currentPage - 1)}
          >
            Previous
          </button>
          <button 
            className="pagination-btn" 
            disabled={currentPage >= totalPages}
            onClick={() => setCurrentPage(currentPage + 1)}
          >
            Next
          </button>
        </div>
      </div>
    </div>
  );
};

export default DataTable;
